/*Table structure for table `blog_category_info` */

DROP TABLE IF EXISTS `blog_category_info`;

CREATE TABLE `blog_category_info` (
  `category_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '标签ID',
  `category_name` varchar(30) NOT NULL COMMENT '标签名称',
  `category_icon_url` text NOT NULL COMMENT '标签图标',
  `remark` text COMMENT '备注',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_category_info` */

/*Table structure for table `blog_category_relation` */

DROP TABLE IF EXISTS `blog_category_relation`;

CREATE TABLE `blog_category_relation` (
  `relation_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '关系ID',
  `blog_id` bigint(20) NOT NULL COMMENT '博客ID',
  `category_id` bigint(20) NOT NULL COMMENT '标签ID',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`relation_id`),
  KEY `fk_blog_category_relation_blog_category_info` (`category_id`),
  KEY `fk_blog_category_relation_blog_info` (`blog_id`),
  CONSTRAINT `fk_blog_category_relation_blog_category_info` FOREIGN KEY (`category_id`) REFERENCES `blog_category_info` (`category_id`),
  CONSTRAINT `fk_blog_category_relation_blog_info` FOREIGN KEY (`blog_id`) REFERENCES `blog_info` (`blog_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_category_relation` */

/*Table structure for table `blog_commnet` */

DROP TABLE IF EXISTS `blog_commnet`;

CREATE TABLE `blog_commnet` (
  `comment_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '评论编号',
  `phone` char(11) NOT NULL COMMENT '用户编号',
  `comment_create` datetime NOT NULL COMMENT '评论时间',
  `blog_id` bigint(20) NOT NULL COMMENT '博客ID',
  `commnet_info` text NOT NULL COMMENT '评论内容',
  `parent_comment_id` int(11) NOT NULL COMMENT '父评论编号',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`comment_id`),
  KEY `fk_blog_commnet_user_info` (`phone`),
  KEY `fk_blog_commnet_blog_info` (`blog_id`),
  CONSTRAINT `fk_blog_commnet_blog_info` FOREIGN KEY (`blog_id`) REFERENCES `blog_info` (`blog_id`),
  CONSTRAINT `fk_blog_commnet_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_commnet` */

/*Table structure for table `blog_info` */

DROP TABLE IF EXISTS `blog_info`;

CREATE TABLE `blog_info` (
  `blog_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '博客ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `phone` char(11) NOT NULL COMMENT '用户ID',
  `blog_title` varchar(60) NOT NULL COMMENT '标题',
  `blog_content` text NOT NULL COMMENT '博客内容',
  `blog_video_url` text NOT NULL COMMENT '博客视频地址',
  `tag_count` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数',
  `collect_count` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数',
  `share_count` int(11) NOT NULL DEFAULT '0' COMMENT '分享数',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`blog_id`),
  KEY `fk_blog_info_user_info` (`phone`),
  CONSTRAINT `fk_blog_info_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_info` */

/*Table structure for table `blog_pic_info` */

DROP TABLE IF EXISTS `blog_pic_info`;

CREATE TABLE `blog_pic_info` (
  `pic_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '图片编号',
  `blog_id` bigint(20) NOT NULL COMMENT '博客ID',
  `pic_url` text NOT NULL COMMENT '图片地址',
  `sort` tinyint(4) NOT NULL COMMENT '是否是主图',
  `pic_desc` varchar(200) DEFAULT NULL COMMENT '图片描述',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`pic_id`),
  KEY `fk_blog_pic_info_blog_info` (`blog_id`),
  CONSTRAINT `fk_blog_pic_info_blog_info` FOREIGN KEY (`blog_id`) REFERENCES `blog_info` (`blog_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_pic_info` */

/*Table structure for table `blog_product_relation` */

DROP TABLE IF EXISTS `blog_product_relation`;

CREATE TABLE `blog_product_relation` (
  `relation_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '关系ID',
  `blog_id` bigint(20) NOT NULL COMMENT '博客ID',
  `pic_url` varchar(255) NOT NULL COMMENT '图片地址',
  `sort` tinyint(4) NOT NULL COMMENT '是否是主要关联商品',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`relation_id`),
  KEY `fk_blog_product_relation_blog_info` (`blog_id`),
  CONSTRAINT `fk_blog_product_relation_blog_info` FOREIGN KEY (`blog_id`) REFERENCES `blog_info` (`blog_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `blog_product_relation` */

/*Table structure for table `cart_info` */

DROP TABLE IF EXISTS `cart_info`;

CREATE TABLE `cart_info` (
  `cart_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '购物车ID',
  `phone` char(11) NOT NULL COMMENT '用户ID',
  `product_id` bigint(20) NOT NULL COMMENT '商品ID',
  `cart_product_amount` int(11) NOT NULL COMMENT '加入购物车商品数量',
  `cart_add_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '加入购物车时间',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`cart_id`),
  KEY `fk_cart_info_user_info` (`phone`),
  KEY `fk_cart_info_product_info` (`product_id`),
  CONSTRAINT `fk_cart_info_product_info` FOREIGN KEY (`product_id`) REFERENCES `product_info` (`product_id`),
  CONSTRAINT `fk_cart_info_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `cart_info` */

/*Table structure for table `city_info` */

DROP TABLE IF EXISTS `city_info`;

CREATE TABLE `city_info` (
  `city_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '城市ID',
  `province_id` int(11) NOT NULL COMMENT '省份ID',
  `city_name` varchar(50) NOT NULL COMMENT '城市名称',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
