/*Table structure for table `collect_info` */

DROP TABLE IF EXISTS `collect_info`;

CREATE TABLE `collect_info` (
  `collect_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '收藏ID',
  `phone` char(11) NOT NULL COMMENT '用户编号',
  `collect_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '收藏时间',
  `blog_id` bigint(20) NOT NULL COMMENT '博客编号',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` bit(8) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`collect_id`),
  KEY `fk_collect_info_user_info` (`phone`),
  KEY `fk_collect_info_blog_info` (`blog_id`),
  CONSTRAINT `fk_collect_info_blog_info` FOREIGN KEY (`blog_id`) REFERENCES `blog_info` (`blog_id`),
  CONSTRAINT `fk_collect_info_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `collect_info` */

/*Table structure for table `content` */

DROP TABLE IF EXISTS `content`;

CREATE TABLE `content` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `category_id` bigint(20) NOT NULL COMMENT '内容类目ID',
  `title` varchar(200) DEFAULT NULL COMMENT '内容标题',
  `url` varchar(500) DEFAULT NULL COMMENT '链接',
  `pic` varchar(300) DEFAULT NULL COMMENT '图片绝对路径',
  `sort_order` int(11) DEFAULT NULL COMMENT '排序',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) DEFAULT NULL COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `category_id` (`category_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

