/*Table structure for table `order_detail` */

DROP TABLE IF EXISTS `order_detail`;

CREATE TABLE `order_detail` (
  `order_detail_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单详情表ID',
  `order_id` bigint(20) NOT NULL COMMENT '订单表ID',
  `product_id` bigint(20) NOT NULL COMMENT '订单商品ID',
  `product_cnt` int(11) NOT NULL DEFAULT '1' COMMENT '购买商品数量',
  `total_price` decimal(8,2) NOT NULL COMMENT '购买单项商品总金额',
  `fee_money` decimal(8,2) NOT NULL COMMENT '优惠分摊金额',
  `product_code` text NOT NULL COMMENT '商品物理编码',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) NOT NULL COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`order_detail_id`),
  KEY `fk_order_detail_order_master` (`order_id`),
  KEY `fk_order_detail_product_info` (`product_id`),
  CONSTRAINT `fk_order_detail_order_master` FOREIGN KEY (`order_id`) REFERENCES `order_master` (`order_id`),
  CONSTRAINT `fk_order_detail_product_info` FOREIGN KEY (`product_id`) REFERENCES `product_info` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10993 DEFAULT CHARSET=utf8;

