  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`order_id`),
  KEY `fk_order_master_user_info` (`phone`),
  CONSTRAINT `fk_order_master_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=1008 DEFAULT CHARSET=utf8;

