/*Table structure for table `product_repertory` */

DROP TABLE IF EXISTS `product_repertory`;

CREATE TABLE `product_repertory` (
  `repertory_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品库存ID',
