/*Table structure for table `user_level` */

DROP TABLE IF EXISTS `user_level`;

CREATE TABLE `user_level` (
  `level_id` tinyint(4) NOT NULL AUTO_INCREMENT COMMENT '会员级别ID',
  `level_name` varchar(10) NOT NULL COMMENT '会员级别名称',
  `point_cpr` int(11) NOT NULL COMMENT '积分消费比',
  `min_money` int(11) NOT NULL COMMENT '该级别的最低消费金额',
  `max_money` int(11) NOT NULL COMMENT '该级别的最高消费金额',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) NOT NULL COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`level_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

