/*Table structure for table `user_login_log` */

DROP TABLE IF EXISTS `user_login_log`;

CREATE TABLE `user_login_log` (
  `login_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '登陆日志ID',
  `phone` char(11) NOT NULL COMMENT '登陆用户ID',
  `login_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '用户登陆时间',
  `login_ip` varchar(15) NOT NULL COMMENT '登陆IP',
  `login_type` int(1) NOT NULL COMMENT '登陆类型',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) NOT NULL COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`login_id`),
  KEY `fk_user_login_log_user_info` (`phone`),
  CONSTRAINT `fk_user_login_log_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `user_login_log` */

/*Table structure for table `user_point_log` */

DROP TABLE IF EXISTS `user_point_log`;

CREATE TABLE `user_point_log` (
  `point_log_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '积分日志ID',
  `phone` char(11) NOT NULL COMMENT '用户ID',
  `source` tinyint(4) NOT NULL COMMENT '积分来源:0订单，1签到，2活动',
  `refer_id` int(11) DEFAULT NULL COMMENT '活动ID',
  `change_point` int(11) NOT NULL COMMENT '变更积分数',
  `user_create` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '创建人',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_deleted` int(8) NOT NULL COMMENT '是否删除',
  `user_modified` varchar(20) NOT NULL DEFAULT 'admin' COMMENT '修改人',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`point_log_id`),
  KEY `fk_user_point_log_user_info` (`phone`),
  CONSTRAINT `fk_user_point_log_user_info` FOREIGN KEY (`phone`) REFERENCES `user_info` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

